import React from 'react';

class CarForm extends React.Component {
    handleYear = () => {
        if(this.state.isYearSelected === false) {
            this.setState({ isYearSelected: true })
        }
    }
    handleMake = () => {
        if(!this.state.isMakeSelected) {
            this.setState({ isMakeSelected: true })
        }
    }
    handleModel = () => {
        if(!this.state.isModelSelected) {
            this.setState({ isModelSelected: true })
        }
    }
    handleTrim = () => {
        if(!this.state.isTrimSelected) {
            this.setState({ isTrimSelected: true })
        }
    }
    render() {
        return (
            <div className="car-form-wrapper">
                <form className="car-form" onSubmit={this.handleSubmit}>
                    <div className="car-row">
                        <div className="car-column">
                            <label htmlFor="year"> Year: </label>
                            <select 
                                className="car-dropdown" 
                                name="year" 
                                value={this.props.year} 
                                onChange={this.props.handleChange}
                            >
                                <option value="select"> Select Year </option>
                                <option onClick={this.handleYear} value="2019"> 2019 </option>
                                <option onClick={this.handleYear} value="2018"> 2018 </option>
                                <option onClick={this.handleYear} value="2017"> 2017 </option>
                                <option onClick={this.handleYear} value="2016"> 2016 </option>
                                <option onClick={this.handleYear} value="2015"> 2015 </option>
                                <option onClick={this.handleYear} value="2014"> 2014 </option>
                                <option onClick={this.handleYear} value="2013"> 2013 </option>
                                <option onClick={this.handleYear} value="2012"> 2012 </option>
                                <option onClick={this.handleYear} value="2011"> 2011 </option>
                                <option onClick={this.handleYear} value="2010"> 2010 </option>
                            </select>
                        </div>
                        <div className="car-column">
                            <label htmlFor="make"> Make: </label>
                            <select 
                                className="car-dropdown" 
                                name="Make" 
                                value={this.props.make} 
                                onChange={this.props.handleChange}
                                onSelect={this.handleMake}
                            >
                                <option value="select"> Select Make </option>
                                <option value="Subaru"> Subaru </option>
                                <option value="Toyota"> Toyota </option>
                                <option value="Honda"> Honda </option>
                            </select>
                        </div>
                    </div>
                    <div className="car-row">
                        <div className="car-column">
                            <label htmlFor="model"> Model: </label>
                            <select 
                                name="Model"
                                className="car-dropdown"
                                value={this.props.model}
                                onChange={this.props.handleChange} 
                                onSelect={this.handleModel}
                            >
                                <option value="select"> Select Model </option>
                                <option value="Outback"> Outback </option>
                                <option value="Tacoma"> Tacoma </option>
                                <option value="Honda"> Accord </option>
                            </select>
                        </div>
                        <div className="car-column">
                            <label htmlFor="Trim"> Trim: </label>
                            <select 
                                className="car-dropdown"
                                name="trim" 
                                value={this.props.trim}
                                onChange={this.props.handleChange}
                                onSelect={this.handleTrim}
                            >
                                <option value="select"> Select Trim </option>
                                <option value="base"> Base </option>
                                <option value="luxury"> Luxury </option>
                                <option value="sport"> Sport </option>
                            </select>
                        </div>
                    </div>
                    <div className="car-row">
                        <label htmlFor="condition"> Condition: </label>
                        <select 
                            placeholder="Select Condition"
                            name="condition"
                            className="car-dropdown"
                            value={this.props.condition}
                            onChange={this.props.handleChange}
                        >
                            <option value="excellent"> Excellent </option>
                            <option value="very good"> Very Good </option>
                            <option value="Good"> Good </option>
                            <option value="Fair"> Fair </option>
                        </select>
                    </div>
                    <button> Submit </button>
                </form>
            </div>
        )
    }
}

export default CarForm;
